import React from "react";

function GuessInput() {
	return (
		<React.Fragment>
			<form id="guess-input-wrapper">
				<label htmlFor="guess-input">Enter Guess:</label>
				<input id="guess-input" type="text" />
			</form>
		</React.Fragment>
	);
}

export default GuessInput;
